/**
 * Extended Error object to signify the intent to join for unclaimed PMR scenarios
 */
export default class ReconnectionError extends Error {
    code: any;
    error: any;
    sdkMessage: any;
    /**
     *
     * @constructor
     * @param {String} [message]
     * @param {Object} [error]
     */
    constructor(message?: string, error?: any);
}
